function echart_1(){
      // mapChart的配置
      var dom = document.getElementById('chart1');
      var myChart = echarts.init(dom, null, {
        renderer: 'canvas',
        useDirtyRect: false
      });
      var app = {};
      
      var option;
  
      const data = [];
  for (let i = 0; i < 5; ++i) {
    data.push(Math.round(Math.random() * 200));
  }
  option = {
    color: ['#0EFCFF'],
    grid: {
        top:'35px',
        height: '55%',
        width: '75%'
      },
    xAxis: {
      max: 'dataMax',
      axisLabel: {
        textStyle: {
          color: '#0efcff' // 设置字体颜色为白色
        }
      }
    },
    yAxis: {
      type: 'category',
      data: ['A区', 'B区', 'C区', 'D区', 'E区'],
      inverse: true,
      animationDuration: 300,
      animationDurationUpdate: 300,
      max: 4, // only the largest 5 bars will be displayed
      axisLabel: {
        textStyle: {
          color: '#0efcff' // 设置字体颜色为白色
        },
      }
    },
    series: [
      {
        realtimeSort: true,
        name: '区域桉树生长情况',
        type: 'bar',
        data: data,
        label: {
          show: true,
          position: 'right',
          valueAnimation: true
        }, 
      }
    ],
    legend: {
      show: true,
      data: ['区域桉树生长情况'],
      textStyle: {
        color: '#0efcff',
      },
    },
    animationDuration: 0,
    animationDurationUpdate: 3000,
    animationEasing: 'linear',
    animationEasingUpdate: 'linear'
  };
  function run() {
    for (var i = 0; i < data.length; ++i) {
      if (Math.random() > 0.9) {
        data[i] += Math.round(Math.random() * 2000);
      } else {
        data[i] += Math.round(Math.random() * 200);
      }
    }
    myChart.setOption({
      series: [
        {
          type: 'bar',
          data
        }
      ]
    });
  }
  setTimeout(function () {
    run();
  }, 0);
  setInterval(function () {
    run();
  }, 3000);
  
      if (option && typeof option === 'object') {
        myChart.setOption(option);
      }
  
      
};

